import React from "react";

const DeleteFolderModal = ({ closeModal, onConfirm, isLightTheme }) => {
  return (
    <div className={`modal-overlay ${isLightTheme ? "light" : "dark"}`}>
      <div className="modal-content">
        <h2>Are you sure you want to delete this folder?</h2>
        <div className="modal-buttons">
          <button className="cancel-button" onClick={closeModal}>Cancel</button>
          <button className="delete-button" onClick={onConfirm}>Delete</button>
        </div>
      </div>
    </div>
  );
};

export default DeleteFolderModal;
